export class RecipeObject{
    constructor(name, description, link, ingredients){
        this.name = name;
        this.description = description;
        this.link = link;
        this.ingredients = ingredients;
    }

    setInformation( information ) {
        this.information = information;
    }

    isSaved(saved){
        this.saved = saved;
    }
}
